import React, { Component } from "react";

export class About extends Component {
  render() {
    let { title, desc, imgurl } = this.props;

    return (
      <div
        className="Container my-4"
        style={{
          alignSelf: "1000px",
          width: "1000px",
          height: "100px",
          alignContent: "center",
        }}
      >
        <img
          src={imgurl}
          style={{ width: "100px", height: "100px" }}
          alt="Sorry"
        />
        News each components {title} {desc}
        <button className="btn btn-dark mx-4">Read More</button>
      </div>
    );
  }
}

export default About;
